import { useNavigate } from "react-router-dom";
import { useEffect } from "react";
import "../styles/cart.css";

export default function OrderSuccess() {
  const navigate = useNavigate();
  const order = JSON.parse(localStorage.getItem("order"));

  // Safety: if order missing
  useEffect(() => {
    if (!order) {
      navigate("/");
    }
  }, [order, navigate]);

  if (!order) return null;

  return (
    <div
      style={{
        maxWidth: "800px",
        margin: "50px auto",
        padding: "30px",
        border: "1px solid #e5e7eb",
        borderRadius: "16px",
        background: "#ffffff",
      }}
    >
      <h1 style={{ color: "#16a34a", textAlign: "center" }}>
        ðŸŽ‰ Order Placed Successfully!
      </h1>

      <p style={{ textAlign: "center", marginBottom: "25px" }}>
        Thank you for shopping with us ðŸ“š <br />
        Your order will be delivered soon.
      </p>

      {/* Customer Info */}
      <div className="order-box">
        <h3>ðŸ‘¤ Customer Details</h3>
        <p><b>Name:</b> {order.customerName}</p>
        <p><b>Phone:</b> {order.phone}</p>
        <p><b>Address:</b> {order.address}</p>
        <p><b>Payment:</b> {order.paymentMethod}</p>
      </div>

      {/* Order Items */}
      <div className="order-box" style={{ marginTop: "20px" }}>
        <h3>ðŸ“š Ordered Books</h3>

        {order.items.map((item, index) => (
          <div
            key={index}
            style={{
              display: "flex",
              justifyContent: "space-between",
              padding: "10px 0",
              borderBottom: "1px solid #e5e7eb",
            }}
          >
            <div>
              <p style={{ margin: 0 }}><b>{item.title}</b></p>
              <small>Qty: {item.quantity}</small>
            </div>

            <p>â‚¹{item.price * item.quantity}</p>
          </div>
        ))}

        <h3 style={{ textAlign: "right", marginTop: "15px" }}>
          Total: â‚¹{order.totalAmount}
        </h3>
      </div>

      {/* Status Info */}
      <div
        style={{
          background: "#f9fafb",
          padding: "20px",
          borderRadius: "12px",
          marginTop: "25px",
        }}
      >
        <h3>ðŸ“¦ What happens next?</h3>
        <ul style={{ lineHeight: "1.8", marginTop: "10px" }}>
          <li>Your order is confirmed</li>
          <li>We are preparing your books</li>
          <li>Delivery partner will contact you</li>
          <li>Payment collected on delivery (if COD)</li>
        </ul>
      </div>

      <div style={{ textAlign: "center" }}>
        <button
          onClick={() => navigate("/")}
          style={{
            marginTop: "30px",
            padding: "12px 28px",
            background: "#2563eb",
            color: "#fff",
            border: "none",
            borderRadius: "12px",
            fontSize: "16px",
            cursor: "pointer",
          }}
        >
          Continue Shopping
        </button>
      </div>
    </div>
  );
}
